const Form = () => {
    const [formData, setFormData] = useState({
        fullName: '',
        companyName: '',
        foundUs: '',
        helpWith: '',
        email: '',
        phone: '',
        projectInfo: '',
        agree: false,
        captchaInput: ''
    });

    const [captcha, setCaptcha] = useState({
        num1: 0,
        num2: 0
